  bmlfSaveLookupField(pobjEvent) {
    this.mbIsLoading = false;
    this.mbIsLookupModal = false;
    if (pobjEvent.type == 'custom') {
      this.mbIsChangeData = true;
      if (pobjEvent.field == "WidgetMasterlist") {
        this.bmlfOpenSelectedRecord(pobjEvent.value);
      } else if (pobjEvent.field == "BMEUserID") {
        this.DashboardMasterSetupModel.UserGroup = pobjEvent.valueKey;
        this.mbIsChangeData = true;
      } else if (pobjEvent.field == 'ConnectedTiles') {
        this.DashboardMasterSetupModel.ConnectedTiles = pobjEvent.value.TileID;
        this.msConnectedTitle = pobjEvent.valueKey;
        this.mbIsChangeData = true;
      } else if (pobjEvent.field == 'Icon1') {
        this.mbIsChangeData = true;
        this.DashboardMasterSetupModel.Icon1 = pobjEvent.value.Icon;
      } else if (pobjEvent.field == 'Icon2') {
        this.DashboardMasterSetupModel.Icon2 = pobjEvent.value.Icon;
        this.mbIsChangeData = true;
      } else if (pobjEvent.field == 'DrilldownModule') {
        this.mbIsChangeData = true;
        this.DashboardMasterSetupModel.DrilldownModule = pobjEvent.valueKey;
      } else if (pobjEvent.field == 'DrilldownScreen') {
        this.mbIsChangeData = true;
        this.DashboardMasterSetupModel.DrilldownScreen = pobjEvent.valueKey;
      } else if (pobjEvent.field == "Screen") {
        // Grid
        if (this.bmlfvalicationDubicate(pobjEvent)) {
          this.marrSetupDetailMainList[this.mnumLineItemRowIndex].ScreenName = pobjEvent.valueKey;
          if (this.marrSetupDetailMainList.length > 1) {
            this.msParentAarry[this.mnumLineItemRowIndex] = [];
            this.marrSetupDetailMainList.forEach((element, i) => {
              if (i != this.mnumLineItemRowIndex) {
                this.msParentAarry[this.mnumLineItemRowIndex].push({
                  "SeqNo": element.SeqNo,
                  "ScreenName": element.ScreenName
                });
              }
            });
          }
        }
      } else if (pobjEvent.field == "DashboardTile") {
        this.mbIsChangeData = true;
        this.marrSetupDetailMainList[this.mnumLineItemRowIndex].DashboardTile = pobjEvent.value.TileID;
        this.marrSetupDetailMainList[this.mnumLineItemRowIndex].TitleName = pobjEvent.valueKey;
      } else if (pobjEvent.field == "IconGrid") {
        this.mbIsChangeData = true;
        this.marrSetupDetailMainList[this.mnumLineItemRowIndex].Icon = pobjEvent.value.Icon;
      }
    }
  }
