  bmlfCloseLookupModalMultiple(pobjData) {
    this.mbIsLookupModalMultiple = pobjData.isLookupModal;
    if (pobjData.eleId != null) {
      let psInputKey = this.bmlfGetInputColumnMultiple(pobjData.field);
      let parrFilterData = [];
      if (psInputKey) {
        if (pobjData.searchValue == null || pobjData.searchValue == '') {
          parrFilterData = pobjData.gridData.filter(obj => obj[psInputKey].toUpperCase() == '');
        } else {
          parrFilterData = pobjData.gridData.filter(obj => obj[psInputKey].toUpperCase() == pobjData.searchValue.toUpperCase());
        }
      }
      if (parrFilterData.length == 0) {
        if (pobjData.eleId == 'txtPicker') {
          this.DashboardMasterSetupModel.UserID = '';
        } else if (pobjData.eleId == 'txtGoToScreen') {
          this.marrSetupDetailMainList[this.mnumLineItemRowIndex].GOTOScreens = '';
        }
      }
      document.getElementById(pobjData.eleId).focus();
    }
  }
