  // So Footer Action finction
  bmlfFooterActionFn(event) {
    if (event == 'searchEvn') {
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsSearchMode = true;
        return false;
      }
      this.bmlfOpenLookupModal('WidgetMasterlist', this.msScreenName, 'WidgetMasterlist', 'click', '', 'custom', 'cmdSearch', 'MASTERDASHBOARD.TITLE');
    } else if (event == 'addEvn') {
      // if (!this.utilService.mbWrite) {
      //     this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      //     return false;
      // };
      if (!this.bmlfValidData()) {
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsAddMode = true;
        return false;
      }
      this.bmlfRefreshForm();
    } else if (event == 'deleteEvn') {
      // if (!this.utilService.mbDelete) {
      //     this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_DELETE'));
      //     return false;
      // };
      if (this.DashboardMasterSetupModel.DashBoardID == '' && this.msFormMode == "I" && this.msCopyRecord == "N" && !this.mbIsChangeData && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
        return false;
      }
      if (this.msPrdKey == '' && this.msCopyRecord == "N" && !this.mbIsChangeData && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
        return false;
      }
      if (this.DashboardMasterSetupModel.DashBoardID == '' && this.msFormMode == "I" && this.msCopyRecord == "Y" && !this.mbIsChangeData && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
        this.bmlfRefreshForm();
        return false;
      }
      this.mbShowDeleteDialog = true;
    } else if (event == 'copyEvn') {
      // if (!this.utilService.mbWrite) {
      //     this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      //     return false;
      // };
      if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_3__.CustomValidator.bmgfNullCheckValidator(this.DashboardMasterSetupModel.DashBoardID)) {
        this.toastMessageService.notifyWarning(this.utilService.bmgfonTranslate("COMMON.MSG.COPY"));
        document.getElementById("txtTitleNamee").focus();
        return;
      }
      if (this.mbIsChangeData || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true) {
        this.mbSaveDialogView = true;
        this.mbIsCopyMode = true;
        return false;
      }
      this.bmlfCopyData();
    }
  }
  bmlfOnConfirmModal(psype) {
    if (psype == 'YES') {
      this.bmlfSubmitData();
      this.mbSaveDialogView = false;
    } else if (psype == 'NO') {
      this.mbSaveDialogView = false;
      if (this.mbIsSearchMode) {
        this.mbIsSearchMode = false;
        this.bmlfOpenLookupModal('WidgetMasterlist', this.msScreenName, 'WidgetMasterlist', 'click', '', 'custom', 'cmdSearch', 'MASTERDASHBOARD.TITLE');
      } else if (this.mbIsAddMode) {
        this.mbIsAddMode = false;
        this.bmlfRefreshForm();
      } else if (this.mbIsCopyMode) {
        this.mbIsCopyMode = false;
        this.bmlfCopyData();
      } else if (this.mbIsDeleteMode) {
        this.mbIsDeleteMode = false;
        this.mbShowDeleteDialog = true;
      } else {
        this.router.navigate(['/main/configuration/dashboard-master-setup-list']);
      }
    } else {
      this.mbSaveDialogView = false;
      this.mbIsSearchMode = false;
      this.mbIsCopyMode = false;
      this.mbIsAddMode = false;
      this.mbIsCloseMode = false;
    }
  }
  // Delete Sales Order Dialog events
  bmlfonDialogAction(psAction) {
    if (psAction == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (psAction == 'Yes') {
      if (this.msFormMode == "I") {
        this.bmlfRefreshForm();
        return false;
      }
      let parrHeaderData = [];
      parrHeaderData = [{
        DashBoardID: this.DashboardMasterSetupModel.DashBoardID
      }];
      let reqData = {
        JSON: JSON.stringify({
          ParaData: parrHeaderData,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.formService.BMGFDeleteWidgedData(reqData).subscribe(res => {
        if (res == null) {
          this.toastMessageService.notifyError(this.utilService.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          {
            this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate('COMMON.MSG.DELETE'));
            this.mbShowDeleteDialog = false;
            let deleteKey = this.msScreenName + " — " + this.msPrdKey;
            this.FieldExtender.bmgfDeleteData(deleteKey);
            this.bmlfRefreshForm();
          }
        } else {
          this.toastMessageService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
