  bmlfSaveProductData() {
    this.mbIsLoading = true;
    let parrHeaderData = [];
    let parrDetailsData = [];
    if (this.msFormMode == "I") {
      this.marrDefoultValueGridData.forEach(ele => {
        ele.DocumentGroup = this.mobjDocumentAuthorizationModel.DocumentGroup;
      });
    }
    this.mobjDocumentAuthorizationModel.RecUserID = this.mobjUserData.UserId;
    parrHeaderData.push(Object.assign({}, this.mobjDocumentAuthorizationModel));
    parrDetailsData = this.marrDefoultValueGridData;
    let pobjJData = {
      HeaderData: parrHeaderData,
      DetailData: parrDetailsData,
      Response: [{
        "ResponseText": "",
        "ErrorCode": ""
      }]
    };
    let pobjJson = {
      JSON: JSON.stringify(pobjJData)
    };
    this.formService.bmlfSaveDocumentAuthorization(pobjJson, this.msFormMode).subscribe(res => {
      this.mbIsLoading = false;
      if (res.Response[0].ErrorCode == "") {
        this.FieldExtender.mbChange = false;
        this.customCtrl.mbChange = false;
        this.mbIsChangeData = false;
        if (this.msFormMode == "I") {
          this.msFormMode = "U";
          this.msCopyRecord = "N";
          this.mobjDocumentAuthorizationModel.DocumentGroup = res.HeaderData[0].DocumentGroup;
          this.msPrdKey = this.mobjDocumentAuthorizationModel.DocumentGroup;
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.SAVE"));
        } else if (this.msFormMode == "U") {
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.EDIT"));
        }
        // FieldExtender -- start update
        let screenKeyValue = this.msScreenName + " — " + this.msPrdKey;
        let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
        if (jsonData.length > 0) {
          this.FieldExtender.bmlfCallApi(jsonData).then(res => {
            if (res != null) {}
          });
        }
        ;
        // FieldExtender -- End update
        if (this.mbIsSearchMode) {
          this.mbIsSearchMode = false;
          this.bmlfOpenLookupModal('DocumentAuthorizationList', this.msScreenName, 'DocumentAuthorizationList', 'click', '', 'custom', 'cmdSearch', 'DOCUMENTAUTHORIZATION.TITLE');
        } else if (this.mbIsAddMode) {
          this.mbIsAddMode = false;
          this.bmlfRefreshForm();
        } else if (this.mbIsCopyMode) {
          this.mbIsCopyMode = false;
          this.bmlfCopyData();
        } else if (this.mbIsCloseMode) {
          this.mbIsCloseMode = false;
          this.router.navigate(["/main/configuration/document-authorization"]);
        } else {
          this.bmlfGetProductData();
        }
      } else {
        this.mbIsSearchMode = false;
        this.mbIsAddMode = false;
        this.mbIsCopyMode = false;
        this.mbIsDeleteMode = false;
        this.mbIsCloseMode = false;
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
      console.log(res);
    }).add(() => {
      this.mbIsLoading = false;
    });
  }
